import React, { useEffect, useState } from 'react'

const Carousel = () => {

    const [carousel, setCarousel] = useState([
        {
            title:"Chefsstöd som får dig att vrida",
            text:"En proffsig coach som får dig att vtida och vända"
        },
        {
            title:"Chefsstöd som får dig att vrida",
            text:"En proffsig coach som får dig att vtida och vända"
        },
        {
            title:"Chefsstöd som får dig att vrida",
            text:"En proffsig coach som får dig att vtida och vända"
        }
    ])

    const renderCarousel = carousel.map(item => {
        return(
            <div>
                <h3>{item.title}</h3>
                <p>{item.text}</p>
            </div>
        )
    })

    function renderOne(){
        setInterval(()=>{
            for(let i=0;i<carousel.length;i++){
                if(i==2){i=0}
                return(renderCarousel[i])
            }
        },1000)
    }



  return (
    <div>
        {renderOne()}
    </div>
  )
}

export default Carousel
